import React from 'react'
import {Link} from "react-router-dom"
import {AppBar , Typography} from '@mui/material'
import Logout from './logout';

export default function Navbarc() {

  return (
    <div>
      <AppBar>
        
            <Typography  variant='h4'sx={{flexGrow:1}}>
                Bookstore
            </Typography>
            
            <Logout/>
        
      </AppBar>
      
    </div>
  )
}
